    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Big Branch Marsh NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Big Branch Marsh NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, plan development, the
    management direction, and strategies for plan implementation. Key planning issues
    include: wildlife habitat, habitat conservation, visitor services, and land protection.",nt"owner_org":
